import React from 'react';

const Homepage = () => {
  // Assume you have a list of blog posts
  const blogPosts = [
    { id: 1, title: "Blog Post 1", image: "url_to_image", content: "Short content for post 1" },
    // Add more blog posts as needed
  ];

  // Dummy categories for the sidebar selector
  const categories = ["Category 1", "Category 2", "Category 3"];

  return (
    <div className="homepage-container">
      {/* Left Section - Blog Posts */}
      <div className="blog-posts-container">
        {blogPosts.map((post) => (
          <div key={post.id} className="blog-post">
            <img src={post.image} alt={post.title} />
            <h2>{post.title}</h2>
            <p>{post.content}</p>
          </div>
        ))}
      </div>

      {/* Right Section - Sidebar with Category Selector */}
      <div className="sidebar-container">
        <select>
          {categories.map((category, index) => (
            <option key={index} value={category}>
              {category}
            </option>
          ))}
        </select>
      </div>
    </div>
  );
};

export default Homepage
